import { HStack, VStack } from 'native-base';

import Logo from '../assets/logo_primary.svg';


export default function screens() {
  return (
    <VStack flex={1} pb={6} bg='gray.700'>
        <HStack
        w='full'
        justifyContent='center'
        alignItems='center'
        bg='gray.600'
        pb={5}
        pt={12}
        px={6}
        >
            <Logo />

        </HStack>
    </VStack>
  );
}
